import React from 'react';
import './App.css';
import Loading from './components/Loading/Loading.js';
import {  Routes,Route,  } from "react-router-dom";

function App() {
  return (
    <div className="App">
    

      <div className='container'>
      
      <Routes>
              <Route path='/' element={<Loading/>}/>
      </Routes>
      </div>
    </div>

    

  );
}

export default App;
